import React from "react";
import NameItem from "./NameItem";

const NameList = (props) => {
    return (
        <ul>
          {props.items.map(name => (
            <NameItem onDelete={props.onDeleteItem}>
              {name}
            </NameItem>
      ))}
        </ul>
      );
}

export default NameList
